The POSIX standard defines the API to access an on-file database, known as DBM . It is an excellent example of an "object-based" API. Here is the definition in C, which hopefully should be easy to read for those involved in FFI. The commentary below should help explaining it for those who miss the subtleties. struct DBM;
typedef struct { void *dptr, size_t dsize } datum; int dbm_clearerr(DBM *);
void dbm_close(DBM *);
int dbm_delete(DBM *, datum);
int dbm_error(DBM *);
datum dbm_fetch(DBM *, datum);
datum dbm_firstkey(DBM *);
datum dbm_nextkey(DBM *);
DBM *dbm_open(const char *, int, mode_t);
int dbm_store(DBM *, datum, datum, int); This API defines two types: DBM and datum. The DBM type was called an "encapsulated" type above. It is designed to contain internal state, and acts as an entry point for the library's behavior. It is completely opaque to the user, who cannot create a DBM themselves since they don't know its size or layout. Instead, they must call dbm_open, and that only gives them a pointer to one . This means all DBMs are "owned" by the library in a Rust sense. The internal state of unknown size is kept in memory controlled by the library, not the user. The user can only manage its life cycle with open and close, and perform operations on it with the other functions. The datum type was called a "transactional" type above. It is designed to facilitate the exchange of information between the library and its user. The database is designed to store "unstructured data", with no pre-defined length or meaning. As a result, the datum is the C equivalent of a Rust slice: a bunch of bytes, and a count of how many there are. The main difference is that there is no type information, which is what void indicates. Keep in mind that this header is written from the library's point of view. The user likely has some type they are using, which has a known size. But the library does not care, and by the rules of C casting, any type behind a pointer can be cast to void. As noted earlier, this type is transparent to the user. But also, this type is owned by the user. This has subtle ramifications, due to that pointer inside it. The question is, who owns the memory that pointer points to? The answer for best memory safety is, "the user". But in cases such as retrieving a value, the user does not know how to allocate it correctly (since they don't know how long the value is). In this case, the library code is expected to use the heap that the user has access to -- such as the C library malloc and free -- and then transfer ownership in the Rust sense. This may all seem speculative, but this is what a pointer means in C. It means the same thing as Rust: "user defined lifetime." The user of the library needs to read the documentation in order to use it correctly. That said, there are some decisions that have fewer or greater consequences if users do it wrong. Minimizing those is what this best practice is about, and the key is to transfer ownership of everything that is transparent .

