} This bug is a classic. Here's what happens when the iterator returns the end-of-iteration marker: The loop condition sets l to zero, and enters the loop because 0 >= 0. The length is incremented, in this case by zero. The if statement is true, so the database is closed. There should be a break statement here. The loop condition executes again, causing a next call on the closed object. The worst part about this bug? If the Rust implementation was careful, this code will work most of the time! If the memory for the Dbm object is not immediately reused, an internal check will almost certainly fail, resulting in the iterator returning a -1 indicating an error. But occasionally, it will cause a segmentation fault, or even worse, nonsensical memory corruption! None of this can be avoided by Rust. From its perspective, it put those objects on its heap, returned pointers to them, and gave up control of their lifetimes. The C code simply must "play nice". The programmer must read and understand the API documentation. While some consider that par for the course in C, a good API design can mitigate this risk. The POSIX API for DBM did this by consolidating the ownership of the iterator with its parent: datum dbm_firstkey(DBM *);
